<template>
    <main-layout>
        <h2>如何做另一个好看的字体?</h2>
        <p>技术储备：animation,background-position</p>
        <p>前期材料：一张图片</p>
        <img src="data:image/png;base64,">
        <h3>1.首先写出字体</h3>
        <div class="demo2">
            <p class="text1">hello ecarx</p>
        </div>
        <h3>2.text-transform:uppercase使字体大写，space-letter调整字体间距,font-weight更改字体粗细</h3>
        <div class="demo2">
            <p class="text2">hello ecarx</p>
        </div>
        <h3>3.使用上一种字体的技术，让图片成为字体中的内容</h3>
        <div class="demo2">
            <p class="text3">hello ecarx</p>
        </div>
        <h3>4.使用动画animation,更改图片位置</h3>
        <div class="demo2">
            <p class="text4">hello ecarx</p>
        </div>

    </main-layout>
</template>

<script>
    import MainLayout from '../layouts/Main.vue'

    export default {
        components: {
            MainLayout
        },
        mounted() {
            window.scrollTo(0, 0);
        }
    }
</script>
<style scoped lang="less">
    @keyframes bgmove {
        0%{
          background-position: 0 0;
        }
        20%{
            background-position: 20px 20px;
        }
        40%{
            background-position: 20px -20px;
        }
        60%{
            background-position: 40px 40px;
        }
        80%{
            background-position: 60px -60px;
        }
        100%{
            background-position: 55px 55px;
        }
    }
    .text1{
        text-align: center;
        font-size: 100px;
    }
    .text2{
        .text1;
        text-transform: uppercase;
        letter-spacing: .2em;
        font-weight: 900;
    }
    .text3{
        .text2;
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        background-image: url("data:image/png;base64,");
    }
    .text4{
        .text3;
        animation: bgmove .25s infinite;
    }
</style>
